import React from "react";

const Eat = props => {
  let filteredList = props.dataString.filter(item => item.type === "eat");
  return (
    <div class="container mb-5 pb-5">
      <h1 className="text-center special-font mt-5">To Eat in Ballywole</h1>
      {filteredList.map(item => (
        <div class="row mt-5 pt-4 justify-content-center">
          <div class="col-sm col-md-4 ">
            <img className="w-100" alt="food" src={item.images}></img>
          </div>
          <div class="col-sm col-md-6 description">
            <h3>{item.title}</h3>
            <p>{item.description}</p>
            <p className="font-italic">{item.address}</p>
            <a href="wikipedia.com">{item.website}</a>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Eat;
